import React from "react";
import { BrowserRouter as Route, Router } from "react-router-dom";
import styles from "./app.module.css";
import Main from "./pages/main";

function App() {
  return (
    <>
      <Router>
        <Route path="/" component={Main} />
      </Router>
    </>
  );
}

export default App;
